import { useState, useEffect } from 'react';

function Logout() {
	const handleRemoveData = () => {
		localStorage.removeItem('email');
		// キーに関連付けられたデータが削除されます
	};
	useEffect(() => {
		document.title = 'ログアウト';
	}, []);
	return (
		<div>
			<button onClick={handleRemoveData}>データを削除</button>
		</div>
	);
}

export default Logout;
